import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import GroupedBarChart from './GroupedBarChart'

// import { Bar } from 'react-chartjs-2';
import {
  Box,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  useTheme,
  makeStyles,
  colors
} from '@material-ui/core';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import Select from 'react-select'
import ArrowRightIcon from '@material-ui/icons/ArrowRight';

const useStyles = makeStyles(() => ({
  root: {}
}));

const options = [{ value: 'gender', label: 'Gender' },
{ value: 'religion', label: 'Religion' },
{ value: 'ethnicity', label: 'Ethnicity' },
{ value: 'maritalstatus', label: 'Marital Status' }
];

const DiagnosesBarChart = ({ className, ...rest }) => {
  const classes = useStyles();
  const theme = useTheme();


  return (
    <Card
      className={clsx(classes.root, className)}
      {...rest}
    >
      <CardHeader
        action={(
          <Button
            endIcon={<ArrowDropDownIcon />}
            size="small"
            variant="text"
          >
            2001-2002
          </Button>
        )}
        title="ICU Diagnoses discovered by Gender"
      />
      <Divider />
      <CardContent>
        <Box
          height={400}
          position="relative"
        >
          <GroupedBarChart data={this.state.data} size={[500, 400]} />

        </Box>
      </CardContent>
      <Divider />
      <Box
        display="flex"
        justifyContent="flex-end"
        p={2}
      >
        {/* <Button
          color="primary"
          endIcon={<ArrowRightIcon />}
          size="small"
          variant="text"
        >
          Overview
        </Button> */}
      </Box>
    </Card>
  );
};

DiagnosesBarChart.propTypes = {
  className: PropTypes.string
};

export default DiagnosesBarChart;
